import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css"; 
const name = "Raj";
const img1 = "https://images.unsplash.com/photo-1615761896293-6d24716c2222?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80";
const img2 = "https://coverartworks.com/wp-content/uploads/2020/11/lorem-ipsum.jpg";
const img3 = "https://coverartworks.com/wp-content/uploads/2020/11/lorem-ipsum.jpg";

ReactDOM.render(
  <>
    <h1 className="heading">my name is {name}</h1>
     <div className="img_div">
      <img src={img1} alt="random images" />
    <img src={img2} alt="random images" />
    <a href="https://www.youtube.com/">
      <img src={img3} alt="random images" />
    </a>
    </div>

</>,
  document.getElementById('root')
);
